textOriginal:
Em que orificio Bozó vai infiar o dedo e tirar mais  uma tagarelice! 
Nada que ele faz dá certo:
* tentou estourar uma bomba no quartel,  não conseguiu;
* tentou ser político,  a única coisa que conseguiu foi praticar RACHADINHA enganando funcionários pobres e ensinar os maus feitos aos filhos;
* como presidente, a única coisa a mostrar é o hábito de mentir por devoção e receitar cloroquina como anti-vírus; 
* tentou fundar um partido, não conseguiu;
* tentou ser religioso, a única coisa que conseguiu foi perdoar as dívidas do Malafaia e de outros ladrões da espécie; 
* como ser humano é uma porcaria que não serve pra nada e a única coisa que diz sobre si mesmo, é que não é brocha, mas o seu histórico de macho é o pior possível.
